// src/pages/AdminDashboard.jsx
import React from 'react';
import { useNavigate } from 'react-router-dom';
import "../styles/AdminDashboard.css";

const AdminDashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="admin-container">
      <div className="navbar">
        <ul>
          <li onClick={() => navigate("/admin-dashboard/accept-users")}>قبول الطلبات</li>
          <li onClick={() => navigate("/admin-dashboard/accept-posts")}>قبول البوستات</li>
          <li onClick={() => navigate("/admin-dashboard/available-properties")}>العقارات المتاحة</li>
        </ul>
      </div>

      <div className="content">
        <h2>مرحبا بك في لوحة تحكم الإدارة</h2>
      </div>
    </div>
  );
};

export default AdminDashboard;
